import React from 'react'

const parentDiv = {
    height: '100px',
    backgroundColor: 'lightblue',
    display: 'flex',
};

const logo = {
    backgroundColor: 'red',
};

const otherPage = {
    backgroundColor: 'black',
};

const auth = {
    backgroundColor: 'yellow',
};
const Navbar = () => {
  return (
    <div style={parentDiv}>
        <div style={logo}>Logo</div>
        <div style={otherPage}>Other page</div>
        <div style={auth}>Auth</div>
        Navbar
    </div>
  )
}

export default Navbar;
